  ];
  return (
    <Box sx={{ display: "flex" }}>
      <Drawer
        variant="permanent"
        anchor="left"
        sx={{ width: drawerWidth, bgcolor: "black" }}
      >
        <Box>
          <Typography varient="h2">myFactory</Typography>
        </Box>
        <List>
          <ListItem>
            <ListItemText primary="hello" />
          </ListItem>
        </List>
      </Drawer>

      <Button>help</Button>
    </Box>
  );
};

export default MainPage;
